import React, { useEffect, useState } from 'react'
import { PokemonContainer } from '../../components/PokemonContainer/PokemonContainer'
import { usePokemons } from '../../hooks/usePokemons'

export const HomePage = () => {
	const [listPokemons, setListPokemons] = useState(usePokemons());

	useEffect(() =>{
		(
			async function(){
					try{
						const response = await usePokemons();
			console.log(response)
			setListPokemons(response)
					}catch(err){
						console.log("err")
					}
			}
	)()
	},[])


  return (
    <div>
      <PokemonContainer onClick={()=> console.log("ir al detalle")} name="pokemon"/>
    </div>
  )
}
